import React from "react";
import "../style/input.css"

class HomePage extends React.Component {
    render() {
        return (
            <div className = "center">
                <p>Please enter your address: </p>
                <input className = "address-field">
                </input>
            </div>
        )
    }
}

export default HomePage;
